document.querySelector("#r_3_3").insertAdjacentHTML("beforebegin",'<div class="toggle-helper">生成随机数并填写<input type="text" class="innum" /><input type="text" class="innum" /><button id=\'laing\'>一键填写</button></div>'),document.querySelector("#laing").addEventListener("click",(e=>{e.preventDefault(),e.stopPropagation();const[{value:t},{value:n}]=document.getElementsByClassName("innum");((e,t)=>{for(const n of e.children){let e=0;for(const{firstElementChild:o}of n.children)try{o.value=8==++e?t()-1:t()}catch{}}})(document.querySelector("#r_3_3").contentWindow.document.querySelector("#MyDataGrid").firstElementChild,((e,t)=>()=>e===t?e:Math.round(Math.random()*(t-e)*10+10*e)/10)(t,n))}));